INSERT INTO `tsp_cms_advert` VALUES (1, 0, 'reg_agreent', 0, 0, 0, 0, '注册协议', '<h3 style=\"text-align:center\"><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">融盛策略服务协议</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略服务协议（以下简称</span>&ldquo;本协议&rdquo;）是平台运营方<span style=\"font-family:微软雅黑\">赢创策略（以下简称</span>&ldquo;本公司&rdquo;）与<span style=\"font-family:微软雅黑\">融盛策略用户（包含策略人和投资人，以下简称</span>&ldquo;用户&rdquo;）就<span style=\"font-family:微软雅黑\">融盛策略服务相关事项订立的有效合约。本协议由协议正文以及本公司通过融盛策略已经发布的或将来可能发布的各类规则和文件的各项规定组成，如融盛策略发布的规则和文件与协议正文有冲突，以公布生效日期或签署日期在后的规则或文件为准执行。用户通过网络页面点击确认接受本协议，即表示用户与本公司已达成合意并同意接受本协议项下的全部约定内容。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">在接受本协议之前，用户务必仔细阅读本协议的全部内容（特别是以粗体下划线标注的内容）。如果用户不同意本协议的任意内容，或者无法准确理解该条款的含义，请不要进行后续操作。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">一、定义</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">本协议中，除非上下文另有解释，下列词语具有如下含义：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、交易平台：指<span style=\"font-family:微软雅黑\">融盛策略信息中介平台，由融盛策略运营。该平台网址为：</span></span></span></span><a href=\"http://www.xcwhwh.cn\">www.xcwhwh.cn</a><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">及本公司根据业务需要不时修改的网址。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、<span style=\"font-family:微软雅黑\">融盛策略：指融盛策略信息平台，面向融盛策略用户提供仅限于沪深所</span>A股交易合作信息发布、交易合作撮合、交易指令通讯、交易风控管理、交易清结算、资金支付（由支付机构提供）等服务的线上中介服务平台。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、策略人：指通过<span style=\"font-family:微软雅黑\">融盛策略注册成为策略人的用户，作为投资人的交易合作方，负责向投资人提供交易策略的自然人。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、投资人：投资人：指通过<span style=\"font-family:微软雅黑\">融盛策略注册成为投资人的用户，作为策略人的交易合作方，负责按策略人交易策略并利用自有资金和账户进行交易的自然人或法人。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、支付机构：指<span style=\"font-family:微软雅黑\">融盛策略委托的为融盛策略用户提供资金划转、查询、结算等支付服务的非金融支付机构。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">二、融盛策略</span></strong></span></span></span></strong><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">服务</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">为用户提供以下服务：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、交易合作撮合服务</span></span></span></p>\r\n\r\n<p><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">作为策略人和投资人的中间方，对策略人的交易谋略和投资人的交易需求进行匹配，撮合双方建立一对一的交易合作关系。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、交易指令通讯服务</span></span></span></p>\r\n\r\n<p><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">为策略人和投资人交易合作过程中提供向对方发送／接收交易指令通讯服务，交易指令包括：策略指令和点卖指令。</span></span></span></span><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">交易指令通讯速度从策略人发出交易指令被</span></span></span></span><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">确认时点至投资人接收到交易指令时点，两时点时间间隔原则不超过</span>60秒。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、交易风控管理服务</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">为最大程度确保策略人与投资人交易合作正常进行，保障双方利益，</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略将：</span></span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1）对存在退市、停牌等风险的交易品种，以风险警示形式（包括但不限于《策略风险警示股名单》、《递延风险警示股名单》等）实时发布</span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2）对于高风险交易品种要求策略人完成指定时长或指定数量的模拟交易后，方具备参与该交易品种交易合作资格。</span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3）根据策略人交易策略历史业绩，调整策略人参与交易合作的额度。</span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4）根据投资人与策略人交易数据和市场系统性风险分析，调整产品范围及具体方案等。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、交易清结算服务</span></span></span></p>\r\n\r\n<p><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">根据策略人和投资人签署的《交易合作协议》相关约定，为双方提供交易清结算服务。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、资金支付服务</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略人与投资人交易合作过程发生的涉及交易款项的支付和结算都将由</span></span></span></span><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">处理。双方应保</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">账户状态正常，并确保账户中有足额的资金以便正常划转。因一方账户状态异常导致交易无法实现的，所有损失由融盛</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略自行承担。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">6、用户交易合作协议生成与保管</span></span></span></p>\r\n\r\n<p><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">为策略人和投资人生成交易合作协议供双方查询、存档。</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">会对策略人和投资人在赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略发生的交易信息及生成的协议保存三年。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">7、服务费及收费标准</span></span></span></p>\r\n\r\n<p><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">向策略人和投资人收取一定的费用，具体收费事项及资费标准由</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">另行与用户约定或者通过</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">进行展示。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">三、声明与承诺</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、用户除需要遵守本协议约定外，还应遵守履行本协议有关的附件。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、用户保证除协议另有约定外，对于其交易合作达成后不得变更、撤销或撤回。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、用户保证不会利用</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略进行非法证券交易、资金非法转移、套现及洗钱等违法犯罪活动；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、用户保证其所参与交易合作的资金来源合法，是该资金的合法所有人，完全有权使用该资金进行交易；如第三人对资金归属、合法性问题发生争议，由用户负责解决，与</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">无关，并保证及时赔偿交易合作方因此所遭受的一切损失</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、用户变更账户信息、通讯地址、电话等相关重要信息，须及时书面或其他</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略同意的方式通知</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略；因用户未及时通知而导致其自身在本协议项下各项权益受到损失的，</span> <span style=\"font-family:微软雅黑\">由用户自行承担全部责任。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">6、用户同意</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略有权限制用户参与交易合作的品种和额度。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">7、用户知晓且同意</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略享有用户合作交易信息的所有权和使用权。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">8、用户知晓且同意</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">仅向用户提供交易信息与服务，</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">既不是策略人与投资人之间交易合作关系的当事人，也不是该合作关系中策略人与投资人的保证人或连带责任人</span> <span style=\"font-family:微软雅黑\">；</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">根据本协议约定向策略人和投资人提供的所有服务仅供策略人和投资人决定是否进行交易合作时予以参考，无论策略人和投资人形成的交易合作关系是否存在第三方担保，在任何情况下均不应视为</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">及其关联方对策略人的交易策略能力及相关交易协议的履行做出了任何明示或默示的担保，亦不应视为</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">及其关联方对投资人的本金和收益做出了明示或默示的担保或保证。策略人和投资人应自行判断相关信息的真实性、准确性、及时性，自主决定是否进行交易合作，并承担由此而导致的一切损失或责任。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">9、用户在交易合作过程产生的相关税费，由用户自行向其主管税务机关申报、缴纳，</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略不负责相关事宜处理。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">四、风险提示</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">用户知晓并同意，通过</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">进行交易合作可能面临如下风险，且除以下揭示的风险外还有其他的外部风险，均需要用户自行承担，赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略不承担任何责任：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、政策监管风险：因宏观政策、监管导向、行业政策、地区发展政策等因素引起的无法实现交易合作的风险。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、违约风险：因交易合作方没有按时履约引起损失的风险。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、因不可抗力因素导致的风险，不可抗力因素包括但不限于以下情形：</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">系统停机维护；</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">所依赖的通讯设备出现故障不能进行数据传输；因台风、地震、海啸、洪水</span> 、停电、战争、恐怖袭击等不可抗力之因素，造成</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">系统障碍不能执行业务的；由于黑客攻击、电信部门技术调整或故障、网站升级、其他第三方的问题等原因而造成的服务中断或者延迟。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">五、通知</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">除本协议另有约定外，本协议履行过程中的通知应以中文书面形式写成。</span></span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">向用户发出的书面通知方式包括但不限于邮寄纸质通知、网站公告、电子邮件、站内信、手机短信</span> 和传真等方式。如以邮寄方式发出书面通知的，则在</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">按照用户在注册赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略时留存的通讯地址交邮后的第三个自然日即视为送达。如以网站公告、电子邮件、手机短信和传真等电子方式发出书面通知的，则在通知发送成功即视为送达。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">六、协议的变更、解除</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">有权随时单方面修改本协议中与用户之间相关的权利义务，并根据本协议约定的方式通知用户，若用户不同意修改本协议，则应当立即停止使用赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略服务；否则，视为同</span> 意并接受修改后的协议。修订的协议一经通知，立即生效。</span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">七、协议终止</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">若出现任何一种以下情况，融盛策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">有权单方面解除本协议且不视为赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略违约：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、用户自行注销</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略账户；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、用户冒用他人名义、盗用他人账户使用</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">服务的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、用户为非法目的使用</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">服务的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、用户从事任何可能侵害</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">系统、资料的行为；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、用户从事任何损害</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">名誉的行为；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">6、用户违反任何法律法规、本协议约定的；</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">7、用户故意利用</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">系统漏洞进行非正常交易合作的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">8、监管机构认为</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛策略</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">提供的服务不再符合相关监管规定的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">因上述第</span>1&mdash;7款原因导致本协议终止的，所导致的全部责任由用户自行承担。</span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">八、争议的解决</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">本协议的订立、效力、解释、履行及争议的解决均适用中华人民共和国法律。在协议履行期间，凡由本协议引起的或与本协议有关的一切争议、纠纷，当事人应首先协商解决。协商不成，各方一致同意提交仲裁委员会仲裁。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">九、其他</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、本协议标题仅为查阅方便而设置，不应构成对本协议的任何解释，不对标题之下的内容及范围作任何限定。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、本协议的附件及各项补充、修订或变更，为本协议不可分割的组成部分，与本协议正文具有同等法律效力。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、用户通过网络页面点击确认后本协议即生效。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、用户在审阅完毕本协议文本时，已阅读并自愿做出以下承诺：&ldquo;本用户已经阅读本协议所有条款，充分了解并清楚知晓相应的权利义务，并愿意承担相关风险。&rdquo;</span></span></span></p>\r\n', '', 1550210639, 1554793054, 1);
INSERT INTO `tsp_cms_advert` VALUES (2, 0, 'celue_agreent', 0, 0, 0, 0, '策略协议', '<h3 style=\"text-align:center\"><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">融盛策略服务协议</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略服务协议（以下简称</span>&ldquo;本协议&rdquo;）是平台运营方<span style=\"font-family:微软雅黑\">融盛策略（以下简称</span>&ldquo;本公司&rdquo;）与<span style=\"font-family:微软雅黑\">融盛策略用户（包含策略人和投资人，以下简称</span>&ldquo;用户&rdquo;）就<span style=\"font-family:微软雅黑\">融盛策略服务相关事项订立的有效合约。本协议由协议正文以及本公司通过融盛策略已经发布的或将来可能发布的各类规则和文件的各项规定组成，如融盛策略发布的规则和文件与协议正文有冲突，以公布生效日期或签署日期在后的规则或文件为准执行。用户通过网络页面点击确认接受本协议，即表示用户与本公司已达成合意并同意接受本协议项下的全部约定内容。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">在接受本协议之前，用户务必仔细阅读本协议的全部内容（特别是以粗体下划线标注的内容）。如果用户不同意本协议的任意内容，或者无法准确理解该条款的含义，请不要进行后续操作。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">一、定义</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">本协议中，除非上下文另有解释，下列词语具有如下含义：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、交易平台：指<span style=\"font-family:微软雅黑\">融盛策略信息中介平台，由融盛策略运营。该平台网址为：</span></span></span></span><a href=\"http://www.xcwhwh.cn\">www.xcwhwh.cn</a><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">及本公司根据业务需要不时修改的网址。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、<span style=\"font-family:微软雅黑\">融盛策略：指融盛策略信息平台，面向融盛策略用户提供仅限于沪深所</span>A股交易合作信息发布、交易合作撮合、交易指令通讯、交易风控管理、交易清结算、资金支付等服务的线上中介服务平台。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、策略人：指通过<span style=\"font-family:微软雅黑\">融盛策略注册成为策略人的用户，作为投资人的交易合作方，负责向投资人提供交易策略的自然人。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、投资人：投资人：指通过<span style=\"font-family:微软雅黑\">融盛策略注册成为投资人的用户，作为策略人的交易合作方，负责按策略人交易策略并利用自有资金和账户进行交易的自然人或法人。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、支付机构：指<span style=\"font-family:微软雅黑\">融盛策略委托的为赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略用户提供资金划转、查询、结算等支付服务的非金融支付机构。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">二、</span></strong></span></span></span></strong><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">赢创</span></strong></span></span></span></strong><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">策略服务</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略为用户提供以下服务：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、交易合作撮合服务</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略作为策略人和投资人的中间方，对策略人的交易谋略和投资人的交易需求进行匹配，撮合双方建立一对一的交易合作关系。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、交易指令通讯服务</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略为策略人和投资人交易合作过程中提供向对方发送／接收交易指令通讯服务，交易指令包括：策略指令和点卖指令。融盛策略交易指令通讯速度从策略人发出交易指令被赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略确认时点至投资人接收到交易指令时点，两时点时间间隔原则不超过</span>60秒。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、交易风控管理服务</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">为最大程度确保策略人与投资人交易合作正常进行，保障双方利益，</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略将：</span></span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1）对存在退市、停牌等风险的交易品种，以风险警示形式（包括但不限于《策略风险警示股名单》、《递延风险警示股名单》等）实时发布</span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2）对于高风险交易品种要求策略人完成指定时长或指定数量的模拟交易后，方具备参与该交易品种交易合作资格。</span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3）根据策略人交易策略历史业绩，调整策略人参与交易合作的额度。</span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4）根据投资人与策略人交易数据和市场系统性风险分析，调整产品范围及具体方案等。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、交易清结算服务</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略根据策略人和投资人签署的《交易合作协议》相关约定，为双方提供交易清结算服务。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、资金支付服务</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略人与投资人交易合作过程发生的涉及交易款项的支付和结算都将由</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创策略支付处理。双方应保证融盛策略账户状态正常，并确保账户中有足额的资金以便正常划转。因一方账户状态异常导致交易无法实现的，所有损失由赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略自行承担。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">6、用户交易合作协议生成与保管</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略为策略人和投资人生成交易合作协议供双方查询、存档。融盛策略会对策略人和投资人在赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略发生的交易信息及生成的协议保存三年。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">7、服务费及收费标准</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略向策略人和投资人收取一定的费用，具体收费事项及资费标准由赢创策略另行与用户约定或者通过融盛策略行展示。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">三、声明与承诺</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、用户除需要遵守本协议约定外，还应遵守履行本协议有关的附件。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、用户保证除协议另有约定外，对于其交易合作达成后不得变更、撤销或撤回。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、用户保证不会利用</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略进行非法证券交易、资金非法转移、套现及洗钱等违法犯罪活动；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、用户保证其所参与交易合作的资金来源合法，是该资金的合法所有人，完全有权使用该资金进行交易；如第三人对资金归属、合法性问题发生争议，由用户负责解决，与<span style=\"font-family:微软雅黑\">融盛策略无关，并保证及时赔偿交易合作方因此所遭受的一切损失</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、用户变更账户信息、通讯地址、电话等相关重要信息，须及时书面或其他<span style=\"font-family:微软雅黑\">融盛策略同意的方式通知赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略；因用户未及时通知而导致其自身在本协议项下各项权益受到损失的，</span> <span style=\"font-family:微软雅黑\">由用户自行承担全部责任。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">6、用户同意<span style=\"font-family:微软雅黑\">融盛策略有权限制用户参与交易合作的品种和额度。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">7、用户知晓且同意<span style=\"font-family:微软雅黑\">融盛策略享有用户合作交易信息的所有权和使用权。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">8、用户知晓且同意<span style=\"font-family:微软雅黑\">融盛策略仅向用户提供交易信息与服务，融盛策略既不是策略人与投资人之间交易合作关系的当事人，也不是该合作关系中策略人与投资人的保证人或连带责任人</span> <span style=\"font-family:微软雅黑\">；融盛策略根据本协议约定向策略人和投资人提供的所有服务仅供策略人和投资人决定是否进行交易合作时予以参考，无论策略人和投资人形成的交易合作关系是否存在第三方担保，在任何情况下均不应视为融盛策略及其关联方对策略人的交易策略能力及相关交易协议的履行做出了任何明示或默示的担保，亦不应视为融盛策略及其关联方对投资人的本金和收益做出了明示或默示的担保或保证。策略人和投资人应自行判断相关信息的真实性、准确性、及时性，自主决定是否进行交易合作，并承担由此而导致的一切损失或责任。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">9、用户在交易合作过程产生的相关税费，由用户自行向其主管税务机关申报、缴纳，<span style=\"font-family:微软雅黑\">融盛策略不负责相关事宜处理。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">四、风险提示</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">用户知晓并同意，通过融盛策略进行交易合作可能面临如下风险，且除以下揭示的风险外还有其他的外部风险，均需要用户自行承担，融盛策略不承担任何责任：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、政策监管风险：因宏观政策、监管导向、行业政策、地区发展政策等因素引起的无法实现交易合作的风险。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、违约风险：因交易合作方没有按时履约引起损失的风险。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、因不可抗力因素导致的风险，不可抗力因素包括但不限于以下情形：<span style=\"font-family:微软雅黑\">赢创策略系统停机维护；融盛策略所依赖的通讯设备出现故障不能进行数据传输；因台风、地震、海啸、洪水</span> 、停电、战争、恐怖袭击等不可抗力之因素，造成<span style=\"font-family:微软雅黑\">融盛策略系统障碍不能执行业务的；由于黑客攻击、电信部门技术调整或故障、网站升级、其他第三方的问题等原因而造成的服务中断或者延迟。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">五、通知</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">除本协议另有约定外，本协议履行过程中的通知应以中文书面形式写成。融盛策略向用户发出的书面通知方式包括但不限于邮寄纸质通知、网站公告、电子邮件、站内信、手机短信</span> 和传真等方式。如以邮寄方式发出书面通知的，则在<span style=\"font-family:微软雅黑\">融盛策略按照用户在注册赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略时留存的通讯地址交邮后的第三个自然日即视为送达。如以网站公告、电子邮件、手机短信和传真等电子方式发出书面通知的，则在通知发送成功即视为送达。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">六、协议的变更、解除</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">融盛策略有权随时单方面修改本协议中与用户之间相关的权利义务，并根据本协议约定的方式通知用户，若用户不同意修改本协议，则应当立即停止使用融盛策略服务；否则，视为同</span> 意并接受修改后的协议。修订的协议一经通知，立即生效。</span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">七、协议终止</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">若出现任何一种以下情况，融盛策略有权单方面解除本协议且不视为融盛策略违约：</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、用户自行注销<span style=\"font-family:微软雅黑\">融盛策略账户；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、用户冒用他人名义、盗用他人账户使用<span style=\"font-family:微软雅黑\">融盛策略服务的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、用户为非法目的使用<span style=\"font-family:微软雅黑\">融盛策略服务的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、用户从事任何可能侵害<span style=\"font-family:微软雅黑\">融盛策略系统、资料的行为；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5、用户从事任何损害<span style=\"font-family:微软雅黑\">融盛策略名誉的行为；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">6、用户违反任何法律法规、本协议约定的；</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">7、用户故意利用<span style=\"font-family:微软雅黑\">融盛策略系统漏洞进行非正常交易合作的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">8、监管机构认为<span style=\"font-family:微软雅黑\">融盛策略提供的服务不再符合相关监管规定的；</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">因上述第</span>1&mdash;7款原因导致本协议终止的，所导致的全部责任由用户自行承担。</span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">八、争议的解决</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">本协议的订立、效力、解释、履行及争议的解决均适用中华人民共和国法律。在协议履行期间，凡由本协议引起的或与本协议有关的一切争议、纠纷，当事人应首先协商解决。协商不成，各方一致同意提交仲裁委员会仲裁。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">九、其他</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、本协议标题仅为查阅方便而设置，不应构成对本协议的任何解释，不对标题之下的内容及范围作任何限定。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、本协议的附件及各项补充、修订或变更，为本协议不可分割的组成部分，与本协议正文具有同等法律效力。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、用户通过网络页面点击确认后本协议即生效。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">4、用户在审阅完毕本协议文本时，已阅读并自愿做出以下承诺：&ldquo;本用户已经阅读本协议所有条款，充分了解并清楚知晓相应的权利义务，并愿意承担相关风险。&rdquo;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 style=\"text-align:center\">&nbsp;</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">融盛策略</span></strong></span></span></span><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">人参与沪深</span>A股交易合作涉及费用及资费标准</strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略人通过融盛</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略参与沪深</span>A股交易合作将涉及交易综合费和履约保证金的发生。如策略人参与持仓时间为T＋1｜D的交易合作还将涉及延递费的发生。</span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">一、交易综合费</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、交易综合费为</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">向策略人收取的费用。交易综合费包含：</span></span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1）</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">为策略人提供交易合作信息发布、交易合作撮合、交易指令通讯、交易风控管理与交易清结算等服务而收取的信息服务费；</span></span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2）</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">代投资人收取用于补偿投资人帐户交易过程中产生的佣金、印花税和过户费等费用；</span></span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3）</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">代第三方支付平台收取用于第三方支付为策略人提供资金存取、冻结、解冻和支付等服务手续费。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、交易综合费以交易</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">金额</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">为计费基数，按每万元交易</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">金额85</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">元计费。计算公式：策略人支付交易综合费＝交易本金</span>&times;</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">85/10000。（下表数值仅为用户查询方便提供，交易综合费具体数值通过&ldquo;</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">&rdquo;策略页面公布，以策略人实际选择为准。）</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、交易综合费于策略人签署《交易合作协议》时即支付。交易综合费一经支付不予退还。当因</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">原因导致系统故障，致使策略人和投资人交易合作失败时，策略人方可向赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略申请退还交易综合费。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">二、履约保证金</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、履约保证金为策略人委托</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">平台冻结用于履行交易亏损赔付义务的保证金。策略人以冻结履约保证金之数额作为承担交易亏损赔付的上限。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、履约保证金以交易本金为计算基数，以触发止损为冻结系数，计算策略人应冻结履约保证金金额。计算公式：策略人冻结履约保证金＝交易本金&times;｜触发止损/0.</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">7</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">｜。（下表数值仅为用户查询方便提供，触发止损具体数值通过</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略点买页面公布，以策略人实际选择为准。）</span></span></span></span></p>\r\n\r\n<table border=\"1\" cellspacing=\"0\" style=\"border-collapse:collapse; border-image:none; border:1pt solid #dbdbdb; margin:auto auto auto 1.65pt; width:644.25pt\">\r\n	<tbody>\r\n		<tr>\r\n			<td rowspan=\"2\" style=\"width:153.9pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">交易本金</span></span></span></p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"border-color:#dbdbdb #dbdbdb #dbdbdb #000000; width:490.35pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5倍杠杆 </span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:198.5pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">触发止损率</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#dbdbdb #dbdbdb #dbdbdb #000000; width:291.85pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">冻结：履约保证金</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb; width:153.9pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1万元</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:198.5pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">-1600</span></span></span></