tyle=\"font-family:微软雅黑\">5万元</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:198.5pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">-8000</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:291.85pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">10000元</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb; width:153.9pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">10万元</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:198.5pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">-16000</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:291.85pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">20000元</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb; width:153.9pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">20万元</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:198.5pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">-32000</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:291.85pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">40000元</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb; width:153.9pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">30万元</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:198.5pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">-48000</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:291.85pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">60000元</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb; width:153.9pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">50万元</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:198.5pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">-80000</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-color:#000000 #dbdbdb #dbdbdb #000000; width:291.85pt\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">100000元</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、交易合作结束，根据</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">清结算结果，如交易盈利，策略人冻结履约保证金全额解冻。如交易亏损，从策略人通过融盛</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略平台冻结保证金中，扣减策略人所应承担亏损赔付额的数额，扣减后余额解冻。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">三、递延费（仅在持仓时间为</span>T＋1｜D的交易存在产生此费用）</strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、递延费为策略人通过</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略平台向投资人申请将交易品种持仓时间递延至下一交易日所支付的费用。递延费包含：</span></span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1）</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">收取的信息服务费。</span></span></span></span><br />\r\n<span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2）</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">代投资人收取用于补偿投资人资金占用费。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、延递费以交易本金为计费基数，根据延递申请次数进行分档计费。具体为：第2至20次延递，单次延递按每万元交易本金</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">15</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">元计费。计算公式：策略人支付延递费＝交易本金</span>&times;1</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">5</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">/10000。</span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">3、交易日当天14:50，若策略人不主动卖出，且符合延递条件，则默认为策略人需要延递，延递费将从策略人于</span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">赢创</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">策略网站的资金账号中自动扣除。</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">本附件系策略人与投资人签署《交易合作协议》的重要组成部分，具有同等法律效力。</span></span></span></span></p>\r\n\r\n<h3><strong><span style=\"font-size:12pt\"><span style=\"color:#000000\"><span style=\"font-family:微软雅黑\"><strong><span style=\"font-family:微软雅黑\">四、关于以上资费标准的声明</span></strong></span></span></span></strong></h3>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">1、</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">平台声明，以上所有涉及资费标准的数据，均为平台根据市场行情阶段性调整的实时标准，该数据具有一定浮动性</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\">2、</span></span></span><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-size:small\">融盛</span></span></span><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\"><span style=\"color:#666666\"><span style=\"font-size:9pt\">策略</span></span></span></span><span style=\"font-size:9pt\"><span style=\"color:#666666\"><span style=\"font-family:微软雅黑\"><span style=\"font-family:微软雅黑\">平台关于以上资费标准不做不予调整的承诺，平台将根据客观的市场行情对资费标准进行适时调整，关于调整结果将及时告知所有平台用户，并将一如既往地尊重用户在新的资费条件下是否选择继续与平台合作的权利。</span></span></span></span></p>\r\n', '', 1550210657, 1554794153, 1);
