INSERT INTO `tsp_cms_page` VALUES (1, '公司简介', '<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:10.5pt\"><span style=\"font-family:宋体\"><span style=\"color:#000000\"><span style=\"font-family:宋体\">&nbsp; &nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:10.5pt\"><span style=\"font-family:宋体\"><span style=\"color:#000000\"><span style=\"font-family:宋体\">&nbsp; &nbsp;<strong> &nbsp;融盛策略以技术创新为基础，市场需求为导向，规范运营为原则，风险控制为核心。为广大机构和个人投资者提供优质、专业的一站式金融服务。</strong></span></span></span></span></p>\r\n\r\n<p><strong><span style=\"font-size:10.5pt\"><span style=\"font-family:宋体\"><span style=\"color:#000000\"><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp;融盛策略自成立以来一直专注于为证券服务、等一、二级市场提供整套的资金服务，并提供配套的金融资讯、大数据分析、咨询服务、资产管理、系统搭建、风控管理等业务的系统解决方案。</span></span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:10.5pt\"><span style=\"font-family:宋体\"><span style=\"color:#000000\"><span style=\"font-family:宋体\">&nbsp;&nbsp;&nbsp;&nbsp;本着&ldquo;诚信为本、服务当先、创业创新、合作共赢&rdquo;的核心价值观，及&ldquo;不断为合作伙伴与客户创造价值&rdquo;的合作共赢理念。</span></span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:10.5pt\"><span style=\"font-family:宋体\"><span style=\"color:#000000\"><span style=\"font-family:宋体\">&nbsp;&nbsp;融盛品牌经过多年的发展，现已成为管理资金规模上百亿，拥有一流金融服务团队与一流资金供应系统的策略行业领导品牌。并与国内外多家券商达成长久合作关系。</span></span></span></span></strong></p>\r\n', '', '', '', 0, 0, 1545439749, 1555641075, 1);
